import React from 'react';
import './progress.css';

function deneme() {
  return (
    <div className="home-page">  
        <div className="card card-2">
          <div className="progress-header">
            <h2>Harcanan Miktar</h2>
            <h2>Ã–ncelik Skoru</h2>
          </div>
          <div className="profile-divider"></div>
          <div className="progress-container">
            <div className="progress-circle" style={{ '--progress': '75' }} data-progress="75%"></div>
            <div className="progress-circle" style={{ '--progress': '50' }} data-progress="50%"></div>
          </div>
          
        </div>
    </div>
  );
}

export default deneme;
